pragma solidity 0.5.7;
pragma experimental ABIEncoderV2;

import { IERC20 } from "openzeppelin-solidity/contracts/token/ERC20/IERC20.sol";

import { Governance } from "./Governance.sol";

import { CitizenRegistry } from "./CitizenRegistry.sol";

/**
 * @title HumanityGovernance
 * @dev Plutocratic voting system that uses Humanity token for voting and proposal fees.
 */
contract HumanityGovernance is Governance {

    constructor(IERC20 humanity, uint proposalFee, uint8 taxRatePercent, address taxDevPoolAddress, address taxCommunityPoolAddress, CitizenRegistry _registry) public
        Governance(humanity, proposalFee, taxRatePercent, taxDevPoolAddress, taxCommunityPoolAddress, _registry) {}

}
